import React from 'react';
import './App.css';
import WorkoutList from './components/WorkoutList';

class App extends React.Component{

  constructor(props){
    super(props);
    this.state = {
      workouts:[],
      activeWorkout:{
        id:null,
        title:'',
      },
      editing:false,
    }
    this.fetchworkouts = this.fetchworkouts.bind(this)
  };
  componentDidMount(){
    this.fetchworkouts()
  }

  fetchworkouts(){
    console.log("Fetching...")
    fetch("http://127.0.0.1:8000/workout-list")
    .then(response => response.json())
    .then(data => 
        this.setState({
          workouts:data
        })
      ).catch(error => console.log(error))
  }


  render(){
    var workouts = this.state.workouts
    var self = this
    return (
      <WorkoutList workouts={workouts}/>

    )
  }
}

export default App;
